import "./blog.css"

export default function Blog() {
  return (
    <div className="blog">
        <h2 className="blog_paragraph">Featured Blog Post</h2>
        <div className="blog_section">
            <p>The journey to a healthier body starts right now</p>
            <div ></div>
        </div>
    </div>
  )
}
